// header menu toggle
let $headerMenuToggle   = document.querySelectorAll('.js-header-menu-toggle')
let $html               = document.querySelector('html')

$headerMenuToggle.forEach((button) => {
	button.addEventListener('click', () => {
		$html.classList.toggle('header_menu_active')
	})
})


// some special code here

// more info
// https://github.com/idangerous/plugins/tree/master/Chop%20Slider%203/Chop%20Slider%203%20jQuery
$(document).ready(function() {
	let $heroSlider = $('.js-hero-slider')

	if (!$heroSlider.length) return

	$heroSlider.cs3({
		autoplay: {
			delay: '4000',
			enabled: 'true'
		},
		captions: {
			enabled: 'true'
		},
		// effects: 'bricks3d',
		// effects: 'bulb',
		effects: 'blinds_h',
		navigation : {
			next: '.js-hero-slider-next',
			prev: '.js-hero-slider-prev'
		},
		pagination: {
			container: '.js-hero-slider-pagination'
		},
		preloader: 'false'
	})
})


