function paginationAjax() {
	let paginationWrap = document.querySelector('.js-pagination-more')

	if (!paginationWrap) return

	let paginationLink = paginationWrap.querySelector('a')

	if (!paginationLink) return

	paginationLink.addEventListener('click', (link) => {
		link.preventDefault()

		let url         = link.target.href
		let request     = new XMLHttpRequest()

		request.open('GET', url)

		request.onreadystatechange = function() {
			if (this.readyState === 4 && this.status === 200) {
				let paginationResult        = document.querySelector('.js-pagination-result')
				paginationResult.innerHTML  = this.responseText

				let paginationMore  = paginationResult.querySelector('.js-pagination-more')
				let newsList        = document.querySelector('.js-news-list')
				let newLi           = paginationResult.querySelectorAll('.js-news-list li')

				// remove used button
				paginationWrap.remove()

				// reinit pagination button
				if (paginationMore) {
					newsList.after(paginationMore)

					// enable script for the AJAX button
					paginationAjax()
				}

				// append new elements to the list
				newLi.forEach((li) => {
					newsList.appendChild(li)
				})
			}
		}

		request.send()
	})
}

paginationAjax()


jQuery(document).ready(function($) {
	// get all values
	let valuesBlocks = $('.woof_mselect_pa_obshhaya-ploshhad').find('option')
	let values = []

	$.each(valuesBlocks, function() {
		values.push($(this).val().replace(',','.'))
	})

	filterAddSquareFields();

	// filter by numbers
	$('input[name="pew-range-filter-from"], input[name="pew-range-filter-to"]').on('input paste', function() {
		if (/\D/g.test(this.value)) {
			this.value = this.value.replace(/\D/g, '')
		}
	})

	// min square
	$('body').on('change', 'input[name="pew-range-filter-from"]', function() {
		var value   = $(this).val()
		var maxVal  = $('input[name="pew-range-filter-to"]').val()

		woof_current_values['filter_min_square'] = value
		woof_current_values['filter_max_square'] = maxVal
		$('input[name="pew-filter-current-square-from"]').val(value)

		$.each(valuesBlocks, function(index) {
			let option          = $(this)
			let option_value    = option.val()

			if (+value <= +option_value && (+maxVal == 0 || +maxVal >= +option_value)) {
				if (!option.is(':disabled') && +option_value > 0) {
					option.prop("selected", true)
				}
			}
			else {
				option.prop("selected", false);
			}

			let isLastElement = index === valuesBlocks.length -1;

			if (isLastElement) {
				valuesBlocks.trigger('change')
			}
		})
	})

	// max square
	$('body').on('change', 'input[name="pew-range-filter-to"]', function() {
		let value       = $(this).val();
		let min_value   = $('input[name="pew-range-filter-from"]').val()

		woof_current_values['filter_min_square'] = min_value
		woof_current_values['filter_max_square'] = value

		$('input[name="pew-filter-current-square-to"]').val(value)

		$.each(valuesBlocks, function(index) {
			let option = $(this)
			let option_value = option.val()

			if (+value >= +option_value && +min_value <= +option_value) {
				if(!option.is(':disabled') && +option_value > 0) {
					option.prop("selected", true).attr("data-test", "1")
				}
			}
			else {
				option.prop("selected", false)
			}

			let isLastElement = index === valuesBlocks.length -1

			if (isLastElement) {
				valuesBlocks.trigger('change')
			}
		})
	})

	// switch to the 1st tab if empty
	setTimeout(function() {
		let urlParams       = new URLSearchParams(window.location.search)
		let product_cat     = urlParams.has('product_cat')

		if (product_cat === false) {
			$(".woof_container_product_cat .woof_list.woof_list_radio li:first-child input").prop("ckecked", true).trigger("click")
		}
	}, 100)

	function filterAddSquareFields() {
		valuesBlocks = $('.woof_mselect_pa_obshhaya-ploshhad').find('option')

		// square
		let urlParams           = new URLSearchParams(window.location.search);
		let filter_min_square   = urlParams.has('filter_min_square') === true ? urlParams.get('filter_min_square') : ''
		let filter_max_square   = urlParams.has('filter_max_square') === true ? urlParams.get('filter_max_square') : ''

		$('input[name="pew-filter-current-square-from"]').val(filter_min_square)
		$('input[name="pew-filter-current-square-to"]').val(filter_max_square)

		$('input[name="woof_t_pa_obshhaya-ploshhad"]').after('<div class="pew-range-fields"><div class="pew-range-from"><input type="text" name="pew-range-filter-from" value="'+filter_min_square+'" placeholder="" autocomplete="off"></div><div class="pew-range-from"><input type="text" name="pew-range-filter-to" value="'+filter_max_square+'" placeholder="" autocomplete="off"></div></div>')
	}

	$(document).on('woof_ajax_done', function() {
		filterAddSquareFields()
	})
})


// show more|less button
let productFilterShowMore = () => {
	let $woof = document.querySelector('.woof')

	if ( !$woof) {
		return
	}

	let $woofMoreBtn = document.createElement('div')

	$woofMoreBtn.classList.add('js-pew-more', 'woof_more')
	$woofMoreBtn.innerHTML = '<span class="woof_more__hide"></span><span class="woof_more__show"> </span>'

	$woof.appendChild($woofMoreBtn)



	let $woofMore = document.querySelector('.js-pew-more')

	if ( !$woofMore) {
		return
	}

	$woofMore.addEventListener('click', () => {
		$html.classList.toggle('woof_more__active')
	})
}

productFilterShowMore()


// allow only numbers at phone input
document.querySelectorAll('.js-phone').forEach((e) => {
	e.addEventListener('keypress', (event) => {
		let charCode = (event.which) ? event.which : event.keyCode

		if (String.fromCharCode(charCode).match(/[^0-9()\-+]/g)) {
			event.preventDefault()

			return false
		}
	})
})


let $popups         = document.querySelectorAll('.js-popup')
let $popupShow      = document.querySelectorAll('.js-popup-show')
let $popupClose     = document.querySelectorAll('.js-popup-close')

$popupShow.forEach((button) => {
	let popupId = button.dataset.popup

	button.addEventListener('click', () => {
		$popups.forEach((e) => {
			let popupSelected = e.dataset.popup

			if (popupSelected === popupId) {
				e.classList.add('active')

				return
			}

			e.classList.remove('active')
		})
	})
})

$popupClose.forEach((button) => {
	button.addEventListener('click', () => {
		$popups.forEach((e) => {
			e.classList.remove('active')
		})
	})
})


